import React from 'react';
import { useLocation } from 'react-router-dom';

const ItemDetailsPage = () => {
  const { state: item } = useLocation();

  return (
    <div>
      {item ? (
        <div className="item-details">
          <h1>{item.dname}</h1>
          <p>Cost: {item.cost}</p>
          <p>{item.desc}</p>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default ItemDetailsPage;
